import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Linda'
        },
        {
          name: 'Frank'
        },
        {
          name: 'Jacky'
        },
        {
          name: 'Weller'
        },
        {
          name: 'Luiza'
        }
      ]
    }
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map(monster => {
          return <div>
            <h1>{monster.name}</h1>
          </div>
        })}
      </div>
    );
  }
}
export default App;
